from typing import List

def wordBreak(s: str, wordDict: List[str]) -> List[str]:
    dp = [[] for _ in range(len(s)+1)]
    dp[0].append("")
    for i in range(1, len(s)+1):
        for j in range(i):
            if s[j:i] in wordDict:
                for prev in dp[j]:
                    dp[i].append(prev+" "+s[j:i] if prev else s[j:i])
    return dp[len(s)]
